import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './components/HomePage'; // Updated import path
import AboutPage from './components/AboutPage'; 
import VideoDeepfake from './components/VideoDeepfake';
import AudioDeepfake from './components/AudioDeepfake';// Updated import path
// import FeaturesPage from './components/FeaturesPage'; // Updated import path
// import ContactPage from './components/ContactPage'; // Updated import path

const App = () => {
  return (
    <Router>
      <div>
        <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/about" element={<AboutPage />} />
        <Route path="/features/video-deepfake" element={<VideoDeepfake />} />
        <Route path="/features/audio-deepfake" element={<AudioDeepfake />} />
          {/* <Route path="/features" element={<FeaturesPage />} />
          <Route path="/contact" element={<ContactPage />} />* */}
        </Routes> 
      </div>
    </Router>
  );
};

export default App;
